window.bookSummaryJSON = "<p>Ahren and his companions journey on to Evergreen, finding new courage after the traumas of the Green Sea. Setting off, then, to traverse the continent in search of the missing Paladin Yollock, it isn't long before they find themselves sucked into a maelstrom of adventures involving a woman who has been robbed, a desperate Cape Verstaad grandee, not to mention a cutthroat city which proves itself a veritable nest of ne'er-do-wells. Controlled by the brilliant assassin Reik Silvermantle, this hub of lawlessness and immorality presents Ahren and his friends with one of their greatest challenges . . .</p>"; 
